import Frame1646 from "../Frame1646";
import Frame1928 from "../Frame1928";
import "./X22SignUpfilled.css";

function X22SignUpfilled(props) {
  const {
    password,
    text26,
    signUp,
    spanText,
    spanText2,
    spanText3,
    frame4Props,
    lockoutline2Props,
    eyeoffoutline22Props,
    frame11Props,
    frame2681Props,
